import React from 'react';
import {Button} from 'reactstrap';
import './LearningPage.style.scss';
import LearningListItem from '../../componentsforLearning/LearningListItem/LearningListItem';
import DATA from '../../componentsforLearning/ListItemData/ListItemData';

const INITIAL_STATE = {
    sections: [
      {

        title: 'BackPack',
        imageUrl: 'https://i.ibb.co/qnhpRHW/Backpacking-Mental-Health.jpg',
        id: 1,
        linkUrl: '/shop/BackPack'
      },
      {
        title: 'Gore-tex',
        imageUrl: 'https://i.ibb.co/HYch24M/20161017-OM-Gore-Tex-heavy-P1-A8817-16bit-final.jpg',
        id: 2,
        linkUrl: '/shop/Goretex'
      },
      {
        title: 'Climbing Boot',
        imageUrl: 'https://i.ibb.co/yn2cH5D/Ribelle-Tech-Od.jpg',
        id: 3,
        linkUrl: '/shop/ClimbingBoot'
      },
      {
        title: 'womens',
        imageUrl: 'https://i.ibb.co/GCCdy8t/womens.png',
        size: 'large',
        id: 4,
        linkUrl: '/shop/womens'
      },
      {
        title: 'mens',
        imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
        size: 'large',
        id: 5,
        linkUrl: '/shop/mens'
      }
    ]
  };
const LerningPageList=()=>{


    return (
        <div className="col-12 learningPage" >

            <div className="lp-header">
                  <h2 className="lp-Title">Articles</h2>
            </div>
            {INITIAL_STATE.sections.map(({id, ...otherProps})=>(
            <div className="lp-content ">
                <LearningListItem key={id} {...otherProps}/>

            </div>
            ))}
        </div>
    );
}

export default LerningPageList;
